import React, { useState } from "react";
import { FaChevronLeft, FaChevronRight, FaStar } from "react-icons/fa";
import { useNavigate } from "react-router-dom";

const testimonialsData = [
  {
    id: 1,
    name: "Amit Sharma",
    rating: 5,
    description:
      "This is the best real estate service I've ever used. The team was very professional and helped me find my dream home.",
    avatar: "https://randomuser.me/api/portraits/men/32.jpg",
    logo: "https://upload.wikimedia.org/wikipedia/commons/a/ab/Logo_TV_2015.png",
  },
  {
    id: 2,
    name: "Shruti Patel",
    rating: 4,
    description:
      "Great experience! Found multiple properties with ease. Highly recommend their services.",
    avatar: "https://randomuser.me/api/portraits/women/44.jpg",
    logo: "https://upload.wikimedia.org/wikipedia/commons/a/ab/Logo_TV_2015.png",
  },
  {
    id: 3,
    name: "Rahul Verma",
    rating: 5,
    description:
      "Professional and trustworthy. They guided me through every step of buying my villa.",
    avatar: "https://randomuser.me/api/portraits/men/65.jpg",
    logo: "https://upload.wikimedia.org/wikipedia/commons/a/ab/Logo_TV_2015.png",
  },
];

const TestimonialsSlider = () => {
  const [currentIndex, setCurrentIndex] = useState(0);
  const navigate = useNavigate();

  const nextSlide = () => {
    setCurrentIndex((prev) => (prev + 1) % testimonialsData.length);
  };

  const prevSlide = () => {
    setCurrentIndex((prev) =>
      prev === 0 ? testimonialsData.length - 1 : prev - 1
    );
  };

  return (
    <section
      className="relative py-16 bg-cover bg-center"
      style={{
        backgroundImage:
          "url('https://images.unsplash.com/photo-1570129477492-45c003edd2be?auto=format&fit=crop&w=1600&q=80')",
      }}
    >
      <div className="absolute inset-0 bg-black/50"></div>
      <div className="relative max-w-6xl mx-auto px-4">
        <h2 className="text-3xl sm:text-4xl font-bold text-white text-center mb-8">
          What Our Clients Say
        </h2>
{/* Slider Container */}
<div className="relative flex items-center justify-center mb-6 w-full overflow-hidden">

  {/* Left Button */}
  <button
    onClick={prevSlide}
    className="absolute left-2 z-20 bg-white/40 backdrop-blur-xl p-2 rounded-full hover:bg-white/60 text-black"
  >
    <FaChevronLeft size={18} />
  </button>

  {/* Slider Track */}
  <div className="flex transition-transform duration-500 ease-out"
       style={{ transform: `translateX(-${currentIndex * 100}%)` }}
  >
    {testimonialsData.map((t, idx) => (
      <div
        key={t.id}
        className={`
          w-[100%] sm:w-[60%] lg:w-[33%]
          px-4 flex-shrink-0
          transition-all duration-500
          ${idx === currentIndex
            ? "scale-105 opacity-100 z-20"
            : "scale-90 opacity-60 z-0"
          }
        `}
      >
        <div className="bg-white/90 rounded-2xl shadow-xl p-6 backdrop-blur-xl">
          
          {/* Logo */}
          <div className="flex justify-center mb-4">
            <img
              src={t.logo}
              className="h-12 object-contain"
              alt="logo"
            />
          </div>

          {/* Description */}
          <p className="text-gray-700 text-center mb-4">
            {t.description}
          </p>

          {/* Profile */}
          <div className="flex flex-col items-center gap-2">
            <img
              src={t.image}
              className="w-16 h-16 rounded-full border shadow-md"
              alt="profile"
            />
            <h3 className="font-semibold text-gray-900">{t.name}</h3>
            <p className="text-yellow-500">
              {"⭐".repeat(t.rating)}
            </p>
          </div>
        </div>
      </div>
    ))}
  </div>

  {/* Right Button */}
  <button
    onClick={nextSlide}
    className="absolute right-2 z-20 bg-white/40 backdrop-blur-xl p-2 rounded-full hover:bg-white/60 text-black"
  >
    <FaChevronRight size={18} />
  </button>
</div>

        {/* All Testimonials Button */}
        <div className="flex justify-center">
          <button
            onClick={() => navigate("/testimonials")}
            className="px-6 py-2 bg-[#07294bff] text-white font-semibold rounded-full hover:bg-black duration-300"
          >
            All Testimonials
          </button>
        </div>
      </div>
    </section>
  );
};

export default TestimonialsSlider;
